tables.table_schema:
CREATE TABLE robot_logs (
  log_id SERIAL PRIMARY KEY,
  error_message TEXT,
  operation_type VARCHAR(50),
  error_timestamp TIMESTAMP
);

CREATE TABLE errors (
    error_id INT PRIMARY KEY,
    error_message TEXT,
    robot_id INT,
    error_timestamp TIMESTAMP
);

CREATE TABLE troubleshooting (
    troubleshooting_id INT PRIMARY KEY,
    robot_id INT,
    action_taken TEXT,
    troubleshooting_timestamp TIMESTAMP
);

CREATE TABLE RobotErrors (
  error_id INT PRIMARY KEY,
  error_message TEXT,
  error_timestamp TIMESTAMP,
  robot_id INT
);

CREATE TABLE RobotLogs (
  log_id INT PRIMARY KEY,
  log_message TEXT,
  log_timestamp TIMESTAMP,
  robot_id INT
);

CREATE TABLE RobotMaintenanceLogs (
  maintenance_log_id INT PRIMARY KEY,
  maintenance_description TEXT,
  maintenance_timestamp TIMESTAMP,
  robot_id INT
);
